.dashbord_page_layout {
  padding: var(--space-medium);
  background-color: var(--background-color-disabled-light);
  min-height: 100%;
}

.dashbord_page_layout .main {
  min-height: 100%;
  flex: 1;
}

.dashbord_page_layout .side {
  min-height: 100%;
  width: 285px;
  flex-shrink: 0;
}

.statist-item {
  flex: 1;
}

.statist-item .number {
  line-height: 40px;
  font-size: 32px;
  color: var(--font-fourth-color);
  font-weight: 500;
  text-align: center;
}

.statist-item .desc {
  margin-top: 4px;
  line-height: 22px;
  font-size: var(--font-size-base);
  color: var(--font-second-color);
  text-align: center;
}

.progress-item {
  flex: 1;
  display: flex;
  flex-direction: column;
  align-items: center;
}

.progress-item + .divider {
  margin: 0 36px;
  border: none;
  border-left: 1px solid var(--border-color-base);
  height: 40px;
}

.progress-item .text {
  margin-top: 8px;
  font-size: var(--font-size-base);
  color: var(--font-second-color);
  text-align: center;
}

.text-button {
  cursor: pointer;
  color: var(--brand-primary);
}

.app-icon {
  width: 40px;
  height: 40px;
  display: flex;
  align-items: center;
  justify-content: center;
  border-radius: 50%;
  background-color: var(--brand-primary-lightest);
  color: var(--brand-primary);
}

.app-text {
  font-size: var(--font-size-small);
  color: var(--font-second-color);
  text-align: center;
  white-space: nowrap;
}

.flex-wrap {
  flex-wrap: wrap !important;
}

.flex-shrink {
  flex-shrink: 0;
}

.flex-fill-text {
  flex: 1;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
  word-wrap: break-word;
  color: var(--font-fourth-color);
}

.form_page_layout {
  padding: var(--space-medium);
  background-color: var(--background-color-disabled-light);
  min-height: 100%;
}

.sub-title {
  height: 48px;
  display: flex;
  justify-content: flex-start;
  align-items: center;
  font-weight: 500;
  color: var(--font-fourth-color);
}

.sub-title::before {
  content: '';
  display: block;
  width: 4px;
  height: 14px;
  background-color: var(--brand-primary);
  margin-right: var(--space-small);
}

